import { registerUser } from '../api/AuthApi'
import {login} from '../api/AuthApi'
export const register = (login,full_name, email,password) => async(dispatch) => {
    try {
        const {data} = await registerUser(login,full_name, email,password)
        dispatch({type:'register', payload: data})   
    } catch (error) {
        console.log(error);
    } 
}

export const loginUser = (loginn,password,email) => async (dispatch) => {
    try {
        const {data} = await login(loginn,password,email)
        dispatch({type:'login', payload:data})
    } catch (error) {
        console.log(error);
    }
}
